column8:
ナンバープレートの様なデザインが恰好イイ！ ガレージ・エプロン☆＼(￣∇￣+)<br />
<br />
取扱いの簡単な綿と化学繊維の混紡布で、週末の機械いじりやDIY、仕事着に、様々な場面で使える作業着です。<br />
これをベースにワッペンを付けたりステンシルをふいたりして、オリジナルな一着を作るのも楽しそうですね～。<br />
<br />
カラーは３種類☆ ページ下部の関連アイテム欄からお好みのカラーをお選びください！<br />
<!-- InstanceEndEditable -->
<br>
<br>
<!-- InstanceBeginEditable name="MOB SPEC" -->
■サイズ<br />
フリーサイズ（胸から裾まで約７８ｃｍ）<br />
■素材<br />
ポリエステル59%、綿27%、レーヨン14%<br />
■製品特性<br />
洗弱30、アイロン中、エンソサラシ不可、ドライ不可、タンブラー乾燥不可<br />
■注意事項<br />
・画像には複数のカラーが写っていますが、お届けの商品はメイン画像のカラー１点です。<br />
・商品画像はお客様のご利用環境によって多少異なった色に見えることがあります。<br />
<!-- InstanceEndEditable -->
